Das Los für die Söhne Josephs fiel vom Jordan, Jericho gegenüber und dessen Wasser, ostwärts, die Wüste, die sich von Jericho in das Gebirge nach Bethel hinaufzieht;
worauf die Grenze sich von Bethel nach Luza fortsetzt und zu dem Gebiete von Archi, Ataroth hinübergeht
und westlich herabsteigt an die Grenze von Jephleti bis zum Gebiete von Unter-Bethhoron, und Gazer; und sein Gebiet endet am großen Meere.
